description:
Tonight, on When Good Surgeries Go BAD!

A young actress coming off a string of successful films. A promising career ready for liftoff. A nose that speaks a bit too much of her Jewish heritage...

A trigger-happy surgeon! A rhinoplasty going horribly wrong! A second surgery needed to fix the first!

"I went in the operating room a celebrity â€” and came out anonymous. It was like being in a witness protection program or being invisible."

A transformed young woman. An unrecognizable face. Friends are shocked. Family is appalled!

"I remember going to a restaurant where I had been going for years. I ran into people I knew and would say, 'Hey.' Nothing."

A life altered. A career ruined. A lifetime of regrets.

"I'll always be this once-famous actress nobody recognizes... because of a nose job."

A beauty... Or a beast?

